import Formulario from "./componentes/Formulario";
import Pie from "./componentes/Pie";
import BFantasmas from "./componentes/BFantasmas";
import bfotones from './componentes/BFantasmas';
import foto0 from './IMG/foto0.jpg';

function App() {
  return (
    <div className="App">
        <Cabeza />                        
        <BFantasmas nombre="Servicios" nombre2="Registros" nombre3="Ayuda" />  
        <boody background={foto0}>

        </boody>      
        <Pie />
    </div>
  );
}

export default App;
